                slug:'ShubaOfficial .6h'
            }
        ]
    }
	render() {
		return (
			<div className="container ">
				<div className="row">
					<div className="col-4">
						<div className="row">

							<BadgeProfile/>
						</div>
                        <div className="row">
                            <Badge/>
                        </div>
					</div>
					<div className="col-sm-8">
                        <BadgesList tweets={this.state.data} slug={this.state.data}/>
					</div>
				</div>
			</div>
		);
	}
}

export default BadgeNew;
